import React, { Component } from "react";
import JokeList from "./JokeList";
import FunctionalJokeList from "./FunctionalJokeList";

/** App component. Renders list of jokes. */

class App extends Component {
  render() {
    return (
      <div className="App">
        <FunctionalJokeList />
      </div>
    );
  }
}

export default App;
